watchNewContacts.apiJsonc:
{
    "url": "/contacts",
    "method": "GET",
    "qs": {
        "limit": 200
    },
    "response": {
        "valid": "{{!(pagination.page === 3200/200 && body.paging.next)}}",
        "error": {
            "message": "[{{statusCode}}] {{body.error}} {{if(body.fields; ErrorParse(body.fields))}}",
            "200": {
                "message": "[{{statusCode}}] The module has reached its limit because your account has more than 3200 contacts."
            }
        },
        "iterate": "{{body.contacts}}",
        "trigger": {
            "id": "{{item.contactID}}",
            "date": "{{item.createdAt}}",
            "type": "date",
            "order": "asc"
        },
        "output": "{{parseDateTime(item, 'createdAt', 'birthdate', 'statuses[]date', 'optIns[]date', 'customProperties.externalCreated', 'identifiers[]channels.sms.statusDate', 'identifiers[]channels.email.statusDate')}}",
        "limit": "{{parameters.limit}}"
    },
    "pagination": {
        "qs": {
            "offset": "{{(pagination.page - 1) * 200}}"
        },
        "condition": "{{body.paging.next}}"
    }
}

