function parseListFields(list) {
  if (!list.length) {
    return null;
  }

  const listFields = list
    .map(field => ({
		name: field.systemName,
		type: iml.convertToFieldTypeIntegromat(field.type),
		label: iml.capitalize(field.name),
		required: field.required
	}));

  return {
    name: 'fields',
    type: 'collection',
    spec: listFields,
    label: 'Fields'
  };
}

