function parseRequestListFields(userFields, apiFields) {
	const findFieldByName = userFieldName => apiFields.find(apiField => apiField.systemName === userFieldName);
	for (let userFieldName in userFields) {
		const field = findFieldByName(userFieldName);
		if (field.type === 'date') {
			userFields[userFieldName] = iml.formatDate(userFields[userFieldName], 'YYYY-MM-DD');
		} else if (field.type === 'dateTime') {
			userFields[userFieldName] = iml.parseDate(userFields[userFieldName]);
		}
	}

	return userFields;
}

