function convertToFieldTypeIntegromat(type) {
	switch(type) {
		case "int":
			return "integer";
		case "float":
			return "number";
		case "bool":
			return "boolean";
		case "string":
			return "text";
		case "email":
			return "email";
		case "url":
			return "url";
		case "date":
		case "dateTime":
			return "date";
	}
}
